import React from 'react';

function StatusBar({ status }) {
  const colorStatus = () => {
    switch ({ status }) {
      case 'Alive':
        return 'green';
      case 'Dead':
        return 'red';
      case 'unknown':
        return 'purple';
    }
  };

  console.log(colorStatus);

  return <div style={{ color: { colorStatus } }}>{status}</div>;
}

export default StatusBar;
